import React from "react";
import { Outlet, Link } from "react-router-dom";
import '../Styles/Header.css'
function Header(){

    return(
        <>
        <header>
            <a><Link to="/">Observatorio  Online</Link></a>
            <div className="HbarraPesquiza">
            <input type="text"/><button onClick="">Search</button>
            </div>
            <a href="#" className="links">Sobre</a>
            <a href="#" className="links">Cadastrar</a>
            <a href="#" className="links">Login</a>
        </header>
        
        <Outlet/>
        </>
    )
}

export default Header
